import React from "react";
import { NavLink } from "react-router-dom";
import "./BottomNav.css";

export default function BottomNav() {
  const Item = ({ to, label, children }) => (
    <NavLink
      to={to}
      className={({ isActive }) => `bn-item ${isActive ? "active" : ""}`}
    >
      <span className="bn-icon">{children}</span>
      <span className="bn-label">{label}</span>
    </NavLink>
  );

  return (
    <nav className="bn-root">
      <div className="bn-inner">
        <Item to="/" label="Home">
          {/* Home Icon */}
          <img
            src={process.env.PUBLIC_URL + "/icons/home.png"}
            alt=""
            className="bn-img"
          />
        </Item>

        <Item to="/cars" label="Buy Car">
          <img
            src={process.env.PUBLIC_URL + "/icons/car.png"}
            alt=""
            className="bn-img"
          />
        </Item>

        <Item to="/shortlists" label="Shortlists">
          <img
            src={process.env.PUBLIC_URL + "/icons/heart.png"}
            alt=""
            className="bn-img"
          />
        </Item>

        <Item to="/sell" label="Sell Car">
          <img
            src={process.env.PUBLIC_URL + "/icons/key.png"}
            alt=""
            className="bn-img"
          />
        </Item>

        <Item to="/account" label="Account">
          <img
            src={process.env.PUBLIC_URL + "/icons/user.png"}
            alt=""
            className="bn-img"
          />
        </Item>
      </div>
    </nav>
  );
}
